import Hero from "./components/hero/Hero";
import Navbar from "./components/navbar/Navbar";
import Categories from "./components/category/Categories";
import Recents from "./components/recents/Recents";

function App() {
  return (
    <>
      <Navbar />
      <Hero />
      <Categories/>
      <Recents/>
    </>
  );
}

export default App;
